import jQuery from "jquery";

jQuery(".ui.form").form({
  fields: {
    name: {
      identifier: "name",
      rules: [
        {
          type: "empty",
          prompt: "Please enter your name",
        },
      ],
    },
    username: {
      identifier: "email",
      rules: [
        {
          type: "empty",
          prompt: "Please enter an email",
        },
      ],
    },
  },
});
